import React from "react";
import { useNavigate } from "react-router-dom";
import "./Doctordashboard.css"; // CSS for styling
import DoctorProfile from './sections/DoctorProfile';
import { Link } from 'react-router-dom';
const Doctordashboard = () => {
  const navigate = useNavigate();
  const doctorName = "Dr. John Doe"; // Example doctor name

  return (
    <div className="dashboard-container">
      {/* Sidebar */}
      <div className="sidebar">
        <h2>Doctor Panel</h2>
        <ul>
        <li><Link to="/DoctorProfile">Doctor profile</Link></li>
          <li onClick={() => navigate("DoctorProfile")}>Create Profile</li>
          <li onClick={() => navigate("/appointments")}>View Appointments</li>
          <li onClick={() => navigate("/availability")}>Availability</li>
          <li onClick={() => navigate("/settings")}>Settings</li>
          <li className="logout" onClick={() => navigate("/logout")}>
            Logout
          </li>
        </ul>
      </div>

      {/* Main Content */}
      <div className="main-content">
        {/* Banner */}
        <div className="banner">
          <h1>Welcome, {doctorName}!</h1>
        </div>

        {/* Content Area */}
        <div className="content">
          <h2>Dashboard Overview</h2>
          <p>This is where you can manage your appointments, profile, and availability.</p>
        </div>

        {/* Footer */}
        <div className="footer">
          <p>Â© 2024 Doctor Dashboard. All Rights Reserved.</p>
        </div>
      </div>
    </div>
  );
};

export default Doctordashboard;
